            WriteLiteral(@"<marquee width=""50%"" direction=""up"" height=""200%"" scrollamount=""1"">  <p>The Stock Exchange is a place where shares of listed companies are bought and sold. Companies list themselves on the stock exchange to raise capital. Shares of companies are traded, after they are listed, through a process of Initial Public Offering (IPO) or Secondary Public Offering (SPO). The share purchase represents ownership of the shareholder in a company to the extent of amount contributed by the investor to the capital of that company.</p><br /></marquee>
        <h6 style=""font-size:140%;color:white;font-family:arial;text-align:center;background-color:black;"">Stock Investment Basics </h6><br />


        <h6 style=""font-size:100%;color:white;font-family:arial;""> 1-Diversify Your Investment:</h6>

        <p style=""margin-left:290px;margin-right: 290px;""> The best way to minimise risk is to diversify your investments across various investment products. If equities are your sole investments, it makes sense to diversify betwee");
            WriteLiteral(@"n different sectors and companies. In this way, loss incurred on some investments can be absorbed or compensated by gains made in others.</p><br />

        <h6 style=""font-size:100%;color:white;font-family:arial;""> 2-Understand Your Risk Profile:</h6>

        <p style=""margin-left:290px;margin-right: 290px;"">As an investor, you must choose between how much risk you can take as all investments carry a certain amount of risk. Consider an investment product not only according to your requirements and how much capital you can invest, but also according to your tolerance of risk. Depending on how ‘risk averse’ or ‘risk-prone’ an investor you are, you may choose an investment accordingly.</p><br />

        <h6 style=""font-size:100%;color:white;font-family:arial;"">3-Do Your Homework Before You Invest:</h6>

        <p style=""margin-left:290px;margin-right: 290px;"">To invest well, you must gather and understand all relevant information regarding the investment you are going to make. This includes studying ");
            WriteLiteral(@"companies’ annual reports, accounts and other statements while keeping abreast of what is happening in the said sector or industry. Consult your investment adviser/ stockbroker to get the latest market information about shares you wish to buy or sell. Do not buy into rumours or be pressured by anyone’s grave but unfounded recommendations before making an investment decision.To invest well, you must gather and understand all relevant information regarding the investment you are going to make. This includes studying companies’ annual reports, accounts and other statements while keeping abreast of what is happening in the said sector or industry. Consult your investment adviser/ stockbroker to get the latest market information about shares you wish to buy or sell. Do not buy into rumours or be pressured by anyone’s grave but unfounded recommendations before making an investment decision.</p><br />

        <h6 style=""font-size:100%;color:white;font-family:arial;"">4-Think Long Term:</h6>

        <p style=""ma");
            WriteLiteral(@"rgin-left:290px;margin-right: 290px;"">
            Investment in shares does not necessarily result in instant yields. Do not invest any money which you may need immediately, since the price of shares can go up and down. Studies have shown that investments properly timed and based on strong fundamentals have been proved to be very profitable for investors in the longer term.
